import supertest from "supertest";
const request = supertest('https://gorest.co.in/public/v2/')

import { expect } from "chai";
import { data } from "browserslist";
import { async } from "regenerator-runtime";

const TOKEN =
    '31dcbd4dc679f2bbb181d3c02b60cafb81085cc56bae659ab93e4b0ea1a2fea0';

describe('Users',() =>{
         //it( 'GET/users',(done) =>{
             // request.get('users?access-token=${TOKEN}').end((err,res) => {
            //console.log(err) 
            //console.log(res.body)
                //expect(res.body).to.not.be.empty;//assetion
              //expect(res.body).to.be.empty;//data is empty to assetion is working fine
               // done();//wait for done mathod 
       // });
       // it( 'GET/users/:id',() =>{
            
          //  return request.get('users/271982?access-token=${TOKEN}').then((res) => {
          //console.log(err) 
          //console.log(res.body)
             // expect(res.body.id).to.not.be.eq(271982);//assetion
            //expect(res.body).to.be.empty;//data is empty to assetion is working fine
              
      //});
     // it( 'GET/users/',() =>{
       // const url = 'users?access-token=${TOKEN}&page=3&gender=female&status=active'
            
       // return request.get(url).then((res) => {
        //console.log(err) 
        //console.log(res.body)
           //expect(res.body).to.not.be.empty;//assetion
          //expect(res.body).to.be.empty;//data is empty to assetion is working fine
            
    //});
//})
    //it( 'GET/users/',() =>{
        //const url = 'users?access-token=${TOKEN}&page=3&gender=female&status=active'
            
        //return request.get(url).then((res) => {
        //console.log(err) 
        //console.log(res.body)
           //expect(res.body).to.not.be.empty;//assetion
          //expect(res.body).to.be.empty;//data is empty to assetion is working fine
           //res.body.forEach((body) => {
            //expect(body.gender).to.eq('female');
            //expect(body.status).to.eq('active');
            
          // });
    //});
    

   // });
   it.only('POST/users', async () => {
       const data = {
            "email": "kutti134345@gmail.com",
            "name": "some33",
            "gender": "female",
            "status": "active"

        };
        //return request
        //.post('users')
        //.set('Authorization','Bearer 31dcbd4dc679f2bbb181d3c02b60cafb81085cc56bae659ab93e4b0ea1a2fea0')
        //.send(data)
        //.then((res)=>{
            //console.log(res.body);
        const res = await request
            .post('users')
            .set('Authorization','Bearer 31dcbd4dc679f2bbb181d3c02b60cafb81085cc56bae659ab93e4b0ea1a2fea0')
            .send(data)
            .then((res)=>{
